import React from 'react'


const Person = ({ person }) => {

    return (
        
        <div >
            <p> {person.name} {person.number}
            
            <button onClick = {() => window.confirm("oletko homo")

            }>Delete</button>
            </p>
        </div>
    )
}


const ListPeople = (props) => {
    return (
        <div>
            {props.namesToShow.map((name) =>
                <Person key={name.name} person={name} />
                

            )}

        </div>
    )
}

export default ListPeople
